import React from 'react';
import { Link } from 'react-router-dom';
import '../Css/Navbar.css';
import Logo from '../myList Logo.svg';

export const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar-section">
                <Link className="logo" to="/">
                    <img src={Logo} alt="Logo"></img>
                </Link>
                <div className="links">
                    <Link className="link" to="/">Search</Link>
                    <span className="mylist-link"><Link className="link" to="/mylist">MyList</Link></span>
                </div>
                <div className="link-dropdown">
                <Link className="items" to="/mylist">Watching</Link>
                        <Link className="items" to="/mylist">Watched</Link>
                        <Link className="items" to="/mylist">Planning</Link>
                </div>


            </div>
        </div>
    )
}
